구좌읍 당근밭이 펼쳐지는 한적한 동네에 자리한 브런치 카페다.&nbsp;
제주 옛 돌집을 개조해서 만들어 카페 내외부에서 돌집 특유의 편안함을 느낄 수 있다. 카페는 총 3개의 건물로 식당, 북카페, 별실로 나뉘어진다. 날이 좋으면 야외테이블을 이용할 수 있고, 북카페 안에서도 커다란 창을 통해 제주 밭담의 풍경을 즐길 수 있다.

????????

북카페는 온돌바닥이라 신발을 슬리퍼로 갈아신은 뒤 들어갈 수 있다. 북카페는 노키즈 존이라 아이와 동반할 경우 별장으로 안내된다.&nbsp;

대표적인 메뉴는 제주 시골풍 샐러드와 쇠고기, 새우를 사용한 브리오슈 수제버거다. 특히 야채가 신선하고 비주얼도 좋은 시골풍 샐러드가 인기가 좋다.&nbsp;


