집주위를 낮게 둘러싼 겹담 위에 사철 꽃이 핍니다.&nbsp;
그래서 꽃담이고 팥을 중심으로 한 브런치가 주메뉴라 팥집입니다.
제주고유의 오메기떡에 로컬식자재를 사용하여 생과일오메기떡을 만들었고,&nbsp;
가마솥에 정성들여 쑤은 달지않은 팥죽과&nbsp;
일출봉의 꿈을 담은 빙수,
해뜨기 전부터 준비하는 아침밥 전복죽씨&nbsp;
그리고 돌담옆에 피는 구철초로 꽃차를 만들었습니다.

100% 국내산 식자재로 정성으로 만드는 꽃담팥집 제주.





??



??







제주도 성산일출봉 매표소 좌측, 소형차전용 주차장에 위치하고 있습니다.
지붕에 잔디가 덮인 국내 최초의 그린루프(Green Roof) 입니다.

메뉴 특징 :&nbsp;
생과일오메기떡: 종류-딸기,감귤,씨없는곶감. 제주산 감귤과 딸기(계절상품)에 제주 고유의 오메기떡을 입혀 세상에 없던 새로운 메뉴를 직접 개발하였습니다.
손님들의 표현에 의하면 쫄깃한 감귤과 쫄깃한 딸기 맛이라고 합니다.
감귤과 딸기, 곶감 등 과일 자체의 풍부한 비타민C와 오메기떡의 쑥과 차조에 포함된 미네랄이 잘 조화되어 건강식으로도 좋은 디저트 메뉴입니다.&nbsp;

가마솥 팥죽양: 숙성과정까지 총18시간을 정성들여 쑤은 전통 팥죽입니다.
팥 고유의 향과 맛을 최대한 살려 깊은 맛을 내고 정갈함을 더했습니다.
2016년7월에 알갱이가 씹혀 고소한 맛을 가미한 팥죽버전2를 같은 가격에 업그레이드 했습니다.&nbsp;


