에이팩토리 베이커리에 이어 커피와 책을 즐길 수 있는 곳으로 탄생한 공간이다.&nbsp;
매일 구워내는 신선한 빵과 커피, 그리고 책을 보며 휴식할수 있는 공간이다.
에이팩토리에서 제작한 다양한 디자인 상품, 굿즈도 구매할 수 있다.&nbsp;
좀더 다양하고 많은 양의 빵을 구매하려면 건너편 에이팩토리 베이커리에 가면 된다.&nbsp;


