유네스코 세계자연유산이자 제주여행 필수코스인 성산일출봉 인근에 위치한 망고음료 카페다. 필리핀 현지농장에서 계약재배한 카라바오 생망고를 이용한 퓨전디저트를 선보이고 있다. 실내인테리어는 보라카이의 노천카페를 연상케한다. 코코넛빙수, 망고홀릭쉐이크, 생망고 와플등을 판매하며 3-4인이 즐길수 있는 사이즈의 신선로망고빙수는 특히나 평이 좋은 대표메뉴다. 다양한 속을 채운 빙수위에 망고를 푸짐이 얹고, 가장 위에 드라이아이스를 흘려 시원함과 비주얼을 동시에 잡았다.&nbsp;

카페 내엔 코코너칩, 바나나칩 등 스낵과 동남아풍 소품도 판매하고 있으며, 족욕 좌석이 있어 성산일출봉에 올라갔다온 피로를 풀며 힐링을 즐길 수 있도록 설계되었다.&nbsp;


